function Output(props) {
    return (
        <section className="section is-medium pt-0 pb-6 has-text-centered" >
        <article className="message is-medium" >
            <div className="message-body" id="output">
            <div class="meme">
                <img id="img" width="800rem" height="auto"/>
                <h2 id="top-text" class="top"></h2>
                <h2 id="bottom-text" class="bottom"></h2>
            </div>
            </div>
        </article>
        </section>
    );

}

export default Output;
